import Kitchen from './Kitchen';

class WaiterButton extends Component{

  WaiterButton (){
    ReactDom.render(<WaiterButton/>, document.getElementById('containerMenu'))
  }
  Kitchen (){
    ReactDom.render(<Kitchen/>, document.getElementById('conteinerMenu'))
  }
