    render(){
        return (
            <article id= "containerMenu">
            <div>
            <BoxHeader/>
            </div>
            <div className="foodOption">
            <BoxHeaderButton rol="Desayuno" customOnButtonClick={this.breakfast}/>
            <BoxHeaderButton rol="Almuerzo" customOnButtonClick={this.lunch}/>
            </div>
            </article>

        )
    }
}

